import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import "./App.css";
import { store } from "./redux/store";
import { Provider } from "react-redux";

ReactDOM.render(
  <Provider store={store}>
    <App />
  </Provider>,

  document.getElementById("root")
);
